  assemblies:
  - RTB.Blazor
  namespace: RTB.Blazor.Services.DataNavigation
  summary: >-
    Provides a simple, in-memory handoff of data between navigations in Blazor and

    a thin wrapper around <xref href="Microsoft.AspNetCore.Components.NavigationManager" data-throw-if-not-resolved="false"></xref> for page/component navigation.
  remarks: >-
    - Keys and values supplied to <xref href="RTB.Blazor.Services.DataNavigation.IDataNavigationService.NavigateTo(System.String%2cSystem.Boolean%2cSystem.Boolean%2cSystem.Collections.Generic.IDictionary%7bSystem.String%2cSystem.Object%7d)" data-throw-if-not-resolved="false"></xref> are stored in-memory
      and are not encoded into the URL. Retrieve them on the destination via <xref href="RTB.Blazor.Services.DataNavigation.IDataNavigationService.TryGetData%60%601(System.String%2c%60%600%40%2cSystem.Boolean)" data-throw-if-not-resolved="false"></xref>.
    - The service is not thread-safe; it relies on Blazor's typical single-threaded UI usage.

    - Lifetime of the stored data matches the service's DI lifetime (commonly <code>Scoped</code> in Blazor).
  example: []
  syntax:
    content: public interface IDataNavigationService
    content.vb: Public Interface IDataNavigationService
