  assemblies:
  - RTB.Blazor
  namespace: RTB.Blazor.Services.DataNavigation
  summary: >-
    Navigates to the specified <code class="paramref">uri</code> and optionally attaches a set of in-memory parameters

    that can be retrieved on the destination via <xref href="RTB.Blazor.Services.DataNavigation.IDataNavigationService.TryGetData%60%601(System.String%2c%60%600%40%2cSystem.Boolean)" data-throw-if-not-resolved="false"></xref>.
  example: []
  syntax:
    content: void NavigateTo(string uri, bool forceLoad = false, bool replace = false, IDictionary<string, object?>? parameter = null)
    parameters:
    - id: uri
      type: System.String
      description: The target URI (relative or absolute) to navigate to.
    - id: forceLoad
      type: System.Boolean
      description: If true, bypasses client-side routing and forces the browser to load the new page from the server.
    - id: replace
      type: System.Boolean
      description: If true, replaces the current entry in the history stack (does not create a new history entry).
    - id: parameter
      type: System.Collections.Generic.IDictionary{System.String,System.Object}
      description: >-
        Optional key-value pairs to store in-memory prior to navigation. Keys are case-sensitive and

        are not included in the URL. Values are available on the destination via <xref href="RTB.Blazor.Services.DataNavigation.IDataNavigationService.TryGetData%60%601(System.String%2c%60%600%40%2cSystem.Boolean)" data-throw-if-not-resolved="false"></xref>.
    content.vb: Sub NavigateTo(uri As String, forceLoad As Boolean = False, replace As Boolean = False, parameter As IDictionary(Of String, Object) = Nothing)
