  namespace: RTB.Blazor.Services.DataNavigation
  summary: Attempts to retrieve a previously stored value for <code class="paramref">key</code> and cast it to <code class="typeparamref">T</code>.
  example: []
  syntax:
    content: bool TryGetData<T>(string key, out T? value, bool remove = true)
    parameters:
    - id: key
      type: System.String
      description: The key used when storing the value.
    - id: value
      type: '{T}'
      description: When this method returns true, contains the value cast to <code class="typeparamref">T</code>. Otherwise, set to default.
    - id: remove
      type: System.Boolean
      description: If true (default), removes the value from the store upon successful retrieval. Set false to keep it for subsequent reads.
    typeParameters:
    - id: T
      description: Expected type of the stored value.
    return:
      type: System.Boolean
      description: True if a value exists for <code class="paramref">key</code> and is of type <code class="typeparamref">T</code>; otherwise false.
